import Grid from "@mui/material/Grid";

// Soft UI Dashboard PRO React components
import SuiBox from "components/SuiBox";


// Soft UI Dashboard PRO React example components
// import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
// import DashboardNavbar from "examples/Navbars/DashboardNavbar";
import { Link } from "react-router-dom";
// import Footer from "examples/Footer";
import { Table } from 'react-bootstrap';

function SweetAlerts() {

  return (


      <SuiBox mt={3} mb={8}>

      <h2 style={{ color: 'green', textAlign: 'center' }}>STP Reports</h2>

      <br />

      <hr style={{ color: 'red' }} />
        <Grid container>
          <Grid item xs={12} md={10} lg={12} py={3}>
            <Grid item xs={15} lg={12}>
              <SuiBox mb={3}>
                <Table striped bordered hover size="sm" style={{ textAlign: "center" }}>

                  <thead>

                    <tr>
                      <th style={{ padding: "15px", borderColor: 'white', width: '200px' }}>AMC Wise STP</th>


                      <th style={{ backgroundColor: "#e6f3ff", padding: "15px", borderColor: 'white', width: '200px' }} ><Link to="/pages/notifications" >Scheme Wise STP</Link></th>

                      <th style={{ backgroundColor: "#e6f3ff", padding: "15px", borderColor: 'white', width: '200px' }} ><Link to="/pages/projects/new-project" >Client Wise STP</Link></th>

                      <th style={{ backgroundColor: "#e6f3ff", padding: "15px", borderColor: 'white', width: '200px' }}><Link to="/ecommerce/orders/order-list" >STP Maturing in 1 Month</Link></th>

                      <th style={{ backgroundColor: "#e6f3ff", padding: "15px", borderColor: 'white', width: '200px' }}>STP Started In Last 1 Month</th>

                    </tr>

                  </thead>

                </Table>

                <br />

                <Table striped bordered hover size="sm" style={{ textAlign: "center", borderColor: 'black' }}>

                  <thead>

                    <tr>

                      <th style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px" }}>AMC Name</th>

                      <th style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px" }}>No Of STPS</th>

                      <th style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px" }}>STP Input</th>

                      <th style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px" }}>Average STP Size</th>

                      <th style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px" }}>Contribution</th>

                    </tr>

                  </thead>

                  <tbody>

                    <tr>

                      <td style={{ fontWeight: "bold", backgroundColor: "#ddd", padding: '15px' }}>Total</td>

                      <td style={{ fontWeight: "bold", backgroundColor: "#ddd", padding: '15px' }}>0</td>

                      <td style={{ fontWeight: "bold", backgroundColor: "#ddd", padding: '15px' }}>0</td>

                      <td style={{ fontWeight: "bold",backgroundColor: "#ddd", padding: '15px' }}>0</td>

                      <td style={{ fontWeight: "bold", backgroundColor: "#ddd", padding: '15px' }}>100%</td>

                    </tr>

                  </tbody>

                </Table>

              </SuiBox>

            </Grid>

          </Grid>

        </Grid>

      </SuiBox>


  );
}

export default SweetAlerts;
